import React from "react";
import Grid from '@material-ui/core/Grid';
import ClearIcon from '@material-ui/icons/Clear';
import "./index.scss";

export const TimeTable = () => {
    return (
        <div>
            <Grid container className='general'>
                <h3>Agenda</h3>
                <ClearIcon/>
            </Grid>
        </div>
    );
};
